import{_ as e,c as l,o as d,ah as a}from"./chunks/framework.DqD713j2.js";const y=JSON.parse('{"title":"Tauri-path 和 fs 的路径","description":"","frontmatter":{},"headers":[],"relativePath":"Document/跨平台桌面端开发/Tauri框架/Tauri-path和fs的路径.md","filePath":"Document/跨平台桌面端开发/Tauri框架/Tauri-path和fs的路径.md","lastUpdated":1750954157000}'),i={name:"Document/跨平台桌面端开发/Tauri框架/Tauri-path和fs的路径.md"};function n(s,t,o,c,r,f){return d(),l("div",null,t[0]||(t[0]=[a('<h1 id="tauri-path-和-fs-的路径" tabindex="-1">Tauri-path 和 fs 的路径 <a class="header-anchor" href="#tauri-path-和-fs-的路径" aria-label="Permalink to &quot;Tauri-path 和 fs 的路径&quot;">​</a></h1><p>文档：</p><ul><li><a href="https://tauri.app/zh-cn/v1/api/js/path/" target="_blank" rel="noreferrer">https://tauri.app/zh-cn/v1/api/js/path/</a></li><li><a href="https://tauri.app/zh-cn/v1/api/js/fs" target="_blank" rel="noreferrer">https://tauri.app/zh-cn/v1/api/js/fs</a></li></ul><p>@tauri-apps/api/path 模块下的 BaseDirectory 枚举类型是用来表示一些预设的系统文件夹，您可以使用它们来获取或设置您的软件的相关目录。</p><p>在不同的系统中，BaseDirectory 的不同值代表的目录可能会有所不同，以下是对照表：</p><table tabindex="0"><thead><tr><th style="text-align:left;">BaseDirectory</th><th style="text-align:left;">目录</th><th style="text-align:left;">用处</th><th style="text-align:left;">Windows</th><th style="text-align:left;">Linux</th><th style="text-align:left;">macOS</th></tr></thead><tbody><tr><td style="text-align:left;">App</td><td style="text-align:left;">软件的主目录</td><td style="text-align:left;">用于存放软件的源代码、配置文件、资源文件等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Local\\{bundle_identifier}</code> 这个路径，其中 <code>{username}</code> 是您的用户名，<code>{bundle_identifier}</code> 是您的软件的唯一标识符。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.local/share/{bundle_identifier}</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Application Support/{bundle_identifier}</code> 这个路径</td></tr><tr><td style="text-align:left;">AppCache</td><td style="text-align:left;">软件的缓存目录</td><td style="text-align:left;">用于存放一些临时的或可重建的数据，例如图片、视频等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Local\\{bundle_identifier}\\Cache</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.cache/{bundle_identifier}</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Caches/{bundle_identifier}</code> 这个路径</td></tr><tr><td style="text-align:left;">AppConfig</td><td style="text-align:left;">软件的配置目录</td><td style="text-align:left;">用于存放一些软件的设置或选项，例如用户偏好、主题等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Roaming\\{bundle_identifier}\\Config</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.config/{bundle_identifier}</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Preferences/{bundle_identifier}</code> 这个路径</td></tr><tr><td style="text-align:left;">AppData</td><td style="text-align:left;">软件的数据目录</td><td style="text-align:left;">用于存放一些软件的重要或持久的数据，例如用户信息、数据库等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Roaming\\{bundle_identifier}\\Data</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.local/share/{bundle_identifier}</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Application Support/{bundle_identifier}</code> 这个路径</td></tr><tr><td style="text-align:left;">AppLocalData</td><td style="text-align:left;">软件的本地数据目录</td><td style="text-align:left;">用于存放一些软件的特定于本机的数据，例如日志、缓存等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Local\\{bundle_identifier}\\Data</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.local/share/{bundle_identifier}</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Application Support/{bundle_identifier}</code> 这个路径</td></tr><tr><td style="text-align:left;">AppLog</td><td style="text-align:left;">软件的日志目录</td><td style="text-align:left;">用于存放一些软件的运行时的日志文件，例如错误、警告、信息等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Local\\{bundle_identifier}\\Logs</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.local/share/{bundle_identifier}/logs</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Logs/{bundle_identifier}</code> 这个路径</td></tr><tr><td style="text-align:left;">Cache</td><td style="text-align:left;">系统的缓存目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的缓存数据。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Local\\Temp</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.cache</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Caches</code> 这个路径</td></tr><tr><td style="text-align:left;">Config</td><td style="text-align:left;">系统的配置目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的配置数据。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Roaming</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.config</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Preferences</code> 这个路径</td></tr><tr><td style="text-align:left;">Data</td><td style="text-align:left;">系统的数据目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的数据。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Roaming</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.local/share</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Application Support</code> 这个路径</td></tr><tr><td style="text-align:left;">Document</td><td style="text-align:left;">系统的文档目录</td><td style="text-align:left;">用于存放一些用户的文档文件，例如 Word、Excel、PDF 等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\Documents</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/Documents</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Documents</code> 这个路径</td></tr><tr><td style="text-align:left;">Executable</td><td style="text-align:left;">系统的可执行文件目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的可执行文件，例如 .exe、.dll 等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Windows\\System32</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>/usr/bin</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>/usr/bin</code> 这个路径</td></tr><tr><td style="text-align:left;">Home</td><td style="text-align:left;">系统的主目录</td><td style="text-align:left;">用于存放一些用户的个人文件，例如桌面、图片、音乐等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~</code> 这个路径</td></tr><tr><td style="text-align:left;">LocalData</td><td style="text-align:left;">系统的本地数据目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的本地数据。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Local</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/.local/share</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Application Support</code> 这个路径</td></tr><tr><td style="text-align:left;">Public</td><td style="text-align:left;">系统的公共目录</td><td style="text-align:left;">用于存放一些所有用户都可以访问的文件，例如共享的文档、图片、音乐等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\Public</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>/usr/share</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>/Users/Shared</code> 这个路径</td></tr><tr><td style="text-align:left;">Resource</td><td style="text-align:left;">系统的资源目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的资源文件，例如图标、字体、语言包等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Windows\\Resources</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>/usr/share</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>/System/Library</code> 这个路径</td></tr><tr><td style="text-align:left;">Runtime</td><td style="text-align:left;">系统的运行时目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的运行时文件，例如临时文件、日志文件等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Windows\\Temp</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>/run/user/{uid}</code> 这个路径，其中 <code>{uid}</code> 是您的用户 ID。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>/tmp</code> 这个路径</td></tr><tr><td style="text-align:left;">Temp</td><td style="text-align:left;">系统的临时目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的临时文件，例如安装包、缓存文件等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Windows\\Temp</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>/tmp</code> 这个路径</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>/tmp</code> 这个路径</td></tr><tr><td style="text-align:left;">Template</td><td style="text-align:left;">系统的模板目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的模板文件，例如文档模板、表格模板等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Roaming\\Microsoft\\Templates</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/Templates</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/Templates</code> 这个路径。</td></tr><tr><td style="text-align:left;">Video</td><td style="text-align:left;">系统的视频目录</td><td style="text-align:left;">用于存放一些系统或其他应用程序的模板文件，例如文档模板、表格模板等。</td><td style="text-align:left;">在 Windows 系统中，它对应于 <code>C:\\Users\\{username}\\AppData\\Roaming\\Microsoft\\Templates</code> 这个路径。</td><td style="text-align:left;">在 Linux 系统中，它对应于 <code>~/Templates</code> 这个路径。</td><td style="text-align:left;">在 macOS 系统中，它对应于 <code>~/Library/Application Support/Microsoft/Office/User Templates</code> 这个路径。</td></tr></tbody></table>',6)]))}const g=e(i,[["render",n]]);export{y as __pageData,g as default};
